script: |
  super -f text -I q11547.spq | sort > q11547.out

inputs:
  - name: q11547.spq
    data: |
      SELECT DISTINCT - - col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( col2 + - col2 + - + col2 + - col1 + + + col1 * - col0 <= col2 );
  - name: tab2

outputs:
  - name: q11547.out
    data: |
